import styled from "styled-components"
import logo from "../../images/logo.svg"

const ContainerLogo = styled.div`
display: flex;
font-size: 35px;
color: #002f52;
`

function Logo () {
    return (
        <div className='logo'>
            <img
                src={logo}
                alt="logo"
                className="logo-img"
            ></img>
            <p> <strong>Will</strong>Verso </p>
        </div>
    )
}

export default Logo
